import { Morph, Menu } from "lively.morphic";
import MorphicDB from "lively.morphic/morphicdb/db.js";
import { connect, disconnect } from "lively.bindings/index.js";
import { SnapshotInspector } from "lively.serializer2/debugging.js";
import { InteractiveMorphSelector } from "lively.morphic/halo/morph.js";
import { createMorphSnapshot } from "lively.morphic/serialization.js";
import { createFiles } from "lively.resources/index.js";
import { flatmap } from "lively.lang/array.js";
import { Path, string } from "lively.lang/index.js";
import TextEditor from "lively.morphic/ide/text-editor.js";
import { guessTextModeName } from "lively.morphic/ide/editor-plugin.js";

export default class ObjectSerializationDebugger extends Morph {

  static get properties() {
    return {
      currentObject: {}
    }
  }

  reset() {
    connect(this.get("open report button"), 'fire', this, 'interactivelyOpenReportButton');
    connect(this.get("choose object button"), 'fire', this, 'interactivelyChooseCurrentObject');
    connect(this.get("edit json button"), 'fire', this, 'interactivelyEditSnapshotJSON');
    connect(this.get("edit package code button"), 'fire', this, 'interactivelyEditPackageCode');
  }

  async interactivelyChooseCurrentObject() {

    let kind = await $world.multipleChoicePrompt("fooo", {
      requester: null,
      animated: true,
      choices: ["live morph", "stored world", "stored part"]
    })

    if (!kind) {
      this.currentObject = null;
      this.update();
      return;
    }

    let choice;
    if (kind === "live morph") {
      let morph = await InteractiveMorphSelector.selectMorph(this.world(), this)
      let type = morph.isWorld ? "world" : "part";
      let name = morph.name;
      choice = {type, name, liveObject: morph};

    } else if (kind === "stored world") {
      let db = MorphicDB.default,
          commits = await db.latestCommits(""),
          items = commits.map(commit => {
            let {type, name} = commit;
            return {isListItem: true, string: `[${type}] ${name}`, value: commit}
          });
      ({selected: [choice]} = await $world.filterableListPrompt(
        "choose object", items, {
          requester: this,
          historyId: "object-serialization-debugger-hist",
          fuzzy: true
        }));
    }


    this.currentObject = choice;
    this.update();
  }

  interactivelyOpenReportButton() {
    return $world.openWorldMenu(null, [
    // return Menu.openAtHand([
      ["summary",                  async () => { let inspector = SnapshotInspector.forSnapshot(await this.ensureSnapshot()); inspector.openSummary(); }],
      ["connections list",         async () => { let inspector = SnapshotInspector.forSnapshot(await this.ensureSnapshot()); inspector.openConnectionsList(); }],
      ["object references report", async () => { let inspector = SnapshotInspector.forSnapshot(await this.ensureSnapshot()); inspector.openObjectReport(); }]
    ]);
  }

  async ensureSnapshot() {    
    let {_id, liveObject, snapshot} = this.currentObject;
    if (snapshot) return snapshot;
    this.currentObject.__dont_serialize__ = ["snapshot"];
    if (liveObject) {
      return this.currentObject.snapshot = await createMorphSnapshot(liveObject);
    }
    let db = MorphicDB.default;
    return this.currentObject.snapshot =
      await db.fetchSnapshot(undefined, undefined, _id);
  }

  async saveSnapshot(snapshot, message = "modified by object serialization debugger") {
    let {_id, liveObject, name, type} = this.currentObject;
    if (liveObject) throw new Error(`Cannot save snapshot of live object, edit and save save the object instead!`);

    if (!_id) throw new Error(`No id of target object, cannot save!`);

    let db = MorphicDB.default;
    let result = await db.commit(type, name, snapshot, {message, user: $world.getCurrentUser()}, undefined, _id)

    this.currentObject.snapshot = snapshot;
  }

  update() {
    let label = this.get("current obejct label")
    if (!this.currentObject) {
      label.textString = "nothing selected";
      this.get("open report button").deactivated = true;
      this.get("edit json button").deactivated = true;
      this.get("edit package code button").deactivated = true;
      return;
    }
    this.get("open report button").deactivated = false;
      this.get("edit json button").deactivated = false;
      this.get("edit package code button").deactivated = false;
    let {type, name} = this.currentObject;
    label.textString = `[${type}] ${name}`;
  }

  async interactivelySearchInObject() {
    let snap = await this.ensureSnapshot();
    snap.packages
  // await db.history(this.currentObject.type, this.currentObject.name)

  }

  async interactivelyEditSnapshotJSON() {
    let {name, type} = this.currentObject, origContent;

    TextEditor.openURL(`<${type}/${name}>`, {
      historyId: "object-serialization-debugger-editor",
      // fn that gets text editor and returns {saved: BOOLEAN, message: STRING}
      customSaveAction: async ed => {
        let snap = await this.ensureSnapshot(),
            oldContent = JSON.stringify(snap, null, 2);
        if (oldContent !== origContent) {
          let really = await $world.confirm("Content change since loading, save anyway");
          if (!really) return {saved: false, message: "canceled"};
        }

        let newSnapshot = JSON.parse(ed.ui.contentText.textString),
            message = await $world.prompt("Commit message", {
              requester: this,
              historyId: "objectserialization-debugger-commit-message",
              input: "modified by object serialization debugger"
            });
        this.saveSnapshot(newSnapshot, message || undefined);
        return {saved: true};
      },
      customLoadContentAction: async (ed, url) => {
        let snap = await this.ensureSnapshot();
        return {content: origContent = JSON.stringify(snap, null, 2), url: `${type}/${name}.json`}
      }
    });
  }

  async interactivelyEditPackageCode() {
    let {name, type} = this.currentObject,
        snap = await this.ensureSnapshot(),
        filePaths = filesInPackages(snap.packages),
        items = filePaths.map(path => {
          let url = path.reduce((url, ea) => string.joinPath(url, ea));
          return {isListItem: true, string: url, value: {path, url}}
        })

    let {selected: [choice]} = await $world.filterableListPrompt("select file to edit",
       items,  {requester: this, historyId: "object-serialization-debugger-hist"});

    if (!choice) return;

    let origContent = Path(choice.path).get(snap.packages);

    TextEditor.openURL(`<${type}/${name} - ${choice.path.slice(1).join("/")}>`, {
      historyId: "object-serialization-debugger-editor",
      // fn that gets text editor and returns {saved: BOOLEAN, message: STRING}
      customSaveAction: async ed => {
        let snap = await this.ensureSnapshot(),
            oldContent = Path(choice.path).get(snap.packages);
        if (oldContent !== origContent) {
          let really = await $world.confirm("Content change since loading, save anyway");
          if (!really) return {saved: false, message: "canceled"};
        }
        Path(choice.path).set(snap.packages, ed.ui.contentText.textString);

        let message = await $world.prompt("Commit message", {
          requester: this,
          historyId: "objectserialization-debugger-commit-message",
          input: "modified by object serialization debugger"
        });
        this.saveSnapshot(snap, message || undefined);
        return {saved: true};
      },
      customLoadContentAction: (ed, url) => {
        return {content: Path(choice.path).get(snap.packages), url: choice.url}
      }
    });

    function filesInPackages() {
      // returns array, that form js path to "files" inside snap.packages
      let result = [];
      lively.lang.tree.prewalk({obj: snap.packages, parents: []},
        node => result.push(...Object.keys(node.obj)
                            .map(key => typeof node.obj[key] === "string"
                                 ? node.parents.concat(key) : null)
                            .filter(Boolean)),
        node => Object.keys(node.obj).map(key => typeof node.obj[key] === "object"
                                          ? {parents: [...node.parents, key], obj: node.obj[key]}
                                          : null)
                                     .filter(Boolean))

      return result;
    }
  }
}
